"use strict";

function f_gold(arr) {
    let left = 0, right = arr.length - 1;
    while (left < right) {
        let mid = (left + right) >> 1;
        if (arr[mid] >= mid) {
            right = mid;
        } else {
            left = mid + 1;
        }
    }
    return arr[left] === left ? left : -1;
}
